import React from "react";

function ShippingCard({shippingCardInfo}) {

    return (
        <div className="shipping-card">
            <img src={shippingCardInfo.imgUrl} className="book-cover"></img>
            <div className="ship-card-info">
                <p className="book-name">{shippingCardInfo.title}</p>
                <div className="ship-book-info">
                    <div className="order-info">
                        <p className="sp-prop">Price: <span className="or-value">{shippingCardInfo.price}</span></p>
                        <p className="sp-prop">Quantity: <span className="or-value">{shippingCardInfo.quantity}</span></p>
                        <p className="sp-prop">Total Price: <span className="or-value">{shippingCardInfo.total}</span></p>
                        <p className="sp-prop">Payment Method: <span className="or-value">{shippingCardInfo.payment}</span></p>
                        <p className="sp-prop">Price: <span className="or-value">{shippingCardInfo.price}</span></p>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default ShippingCard;
